// "12"
function circular_shift(x, shift){
  let str = x.toString();
  let len = str.length;
  if(shift > len){
    return str.split('').reverse().join('');
  }
  else{
    shift = shift % len;
    return str.slice(len - shift) + str.slice(0, len - shift);
  }
}

