function sort_array(arr){
  return arr.sort((a, b) => {
    const bitCountA = a.toString(2).replace(/0/g, '').length;
    const bitCountB = b.toString(2).replace(/0/g, '').length;
    if (bitCountA === bitCountB) {
      return a - b;
    }
    return bitCountA - bitCountB;
  });
}

